import { createSlice } from "@reduxjs/toolkit";

const initialState = [
  {
    id: "1",
    product: "zapatos",
  },
  { 
    id: "2",
     product: "libros" },
];
export const productSlice = createSlice({
  name: "products",
  initialState: [],
  reducers: {},
});
// export const{}= productSlice.actions
export default productSlice.reducer;
